  false,\n\t\"url\": null,\n\t\"notes\": \"The EuroSTRATAFORM Po and Apennine Sediment
  Transport and Accumulation (PASTA) experiment was an international study of sediment-transport
  processes and formation of geological strata in the Adriatic Sea. The study was
  funded by the Office of Naval Research and the European Union, and conducted in
  the winter of 2002-2003. The U. S. Geological Survey deployed three tripods at 10-m
  and 20-m depths off the Italian coast, near the town of Civitinova and the mouth
  of the Chienti River. The data include measurements related to coastal oceanographic
  properties and sediment-transport dynamics, and are being used to test and improve
  numerical models of circulation and transport of sediment and pollutants.\",\n\t\"owner_org\":
